    function HuyDeNghi(obj) {
        var ele = $(obj);

        var id_denghi = ele.data("model-id");

        var url = `/NV_TienHanhXacMinh/HuyDeNghi`
        swal.fire({
            title: 'Xác nhận',
            text: "Hủy đề nghị",
            icon: 'warning',
            showCancelButton: true,
            confirmButtonText: 'Hủy!',
            cancelButtonText: 'Quay lại!',
            reverseButtons: true
        }).then((result) => {
            if (result.isConfirmed) {
                $.post(url, { id: id_denghi })
                    .done(function (data) {
                        if (data != false) {
                            oTable_DanhSachDeNghi.draw()
                            Swal.fire({
                                icon: 'success',
                                title: 'Thành Công',
                                text: `Đề nghị đã được hủy`,
                                timer: 2000,
                                showConfirmButton: false,
                            }).then(() => { location.reload() })
                        }
                        else {
                            Swal.fire({
                                icon: 'error',
                                title: 'Xảy ra lỗi',
                                text: `Đề nghị chưa được hủy, vui lòng kiểm tra lại`,
                                timer: 2000,
                                showConfirmButton: false,

                            })
                        }

                    })
                    .fail(function (data) {
                        Swal.fire({
                            icon: 'error',
                            title: 'Không thành công',
                            text: `Xảy ra lỗi`,
                            timer: 2000,
                            showConfirmButton: false,
                        })
                    });
            }
            else if (result.dismiss === Swal.DismissReason.cancel) {

            }
        })
    }

